.isAuthenticated() always false || passport local strategy<p>There are many similar posts to this one, but I haven't found a qualifying solution in any of the answers to those posts that have helped me with this.</p>
<p><strong>the code</strong></p>
<pre><code>&quot;use strict&quot;;

require('dotenv').config();

const auth     = require('./auth.js');

const express       = require('express');
const passport      = require('passport');
const bcrypt        = require('bcrypt');
const mongo         = require('mongodb');
const session       = require('express-session');
const cors          = require('cors');
const util          = require('util');

const app  = express();
const port = process.env.PORT || 8080;

app.use(cors());
app.use(express.json());
app.use(express.urlencoded({extended:true}));

app.use(session({
  secret: process.env.SESSION_SECRET,
  resave: true,
  saveUninitialized: true,
  cookie: {
    secure: false,
    maxAge: 1000 * 60 * 60 * 24 * 7
  }
}));

app.use(passport.initialize());
app.use(passport.session());

mongo.connect(process.env.DATABASE, {useNewUrlParser: true, useUnifiedTopology: true}, (err, db) =&gt; {
  if (err) {
    console.log('Database error: ' + err);
  } else {
    console.log('Database connection successful');

    auth(app, db);

    app.route('/test').get((req, res) =&gt; {
      res.send('The connection works!')
    });

    const ensureAuthenticated = (req, res, next) =&gt; {
      console.log('isAuth() is: ' + req.isAuthenticated());
      console.log('session store: ' + util.inspect(req.session, {showHidden: false, depth: null}));
      if (req.isAuthenticated()) return next();
      res.send('user not authenticated, begone! &gt;:(');
    }

    app.route('/profile').get(
      ensureAuthenticated,
      (req, res) =&gt; {
        res.render({username: req.user.username});
      }
    );

    app.post('/login', 
      (request, response, next) =&gt; {
        console.log(request.session)
        passport.authenticate('local', 
        (err, user, info) =&gt; {
          if(!user){ response.send(info.message);}
          else{
            request.login(user, function(error) {
              if (error) return next(error);
              console.log(&quot;Request Login supossedly successful.&quot;);
              return response.send('Login successful');
            });
            //response.send('Login successful');
          }

        })(request, response, next);
      }
    );

    app.route('/register').post((req, res, next) =&gt; {
      const hash = bcrypt.hashSync(req.body.password, 13);
      db.db().collection('users').findOne({username: req.body.username}, (err, user) =&gt; {
        if (err) {
          next(err);
        } else if (user) {
          res.send('user already exists :(');
        } else {
          db.db().collection('users').insertOne({
            username: req.body.username,
            password: hash
          },
            (err, doc) =&gt; {
              if (err) {
                res.send('registration mongo error');
              } else {
                next(null, user);
              }
            }
          )
        }
      })
    },
      passport.authenticate('local', {failureMessage: 'passport authenticate failure'}),
      (req, res, next) =&gt; {
        console.log('registration successful');
        req.logIn(req.user, err =&gt; {
          if (err) next(err)
          return console.log(&quot;i'm trying: &quot; + req.user);
        });
        res.send('registration successful!!! :D');
      }
    );

    app.listen(port, () =&gt; {console.log(`Listening on port: ${port}`)});
  }
});
</code></pre>
<p><em>auth.js</em></p>
<pre><code>const passport      = require('passport');
const LocalStrategy = require('passport-local');
const ObjectID      = require('mongodb').ObjectID;
const bcrypt        = require('bcrypt');

module.exports = (app, db) =&gt; {
  passport.use(new LocalStrategy(
    (username, password, done) =&gt; {
      db.db().collection('users').findOne({username: username}, (err, user) =&gt; {
        console.log(`${username} attempted to log in`);
        if (err) return done(err);
        if (!user) return done(null, false);
        if (!bcrypt.compareSync(password, user.password)) return done(null, false);
        console.log('local strategy successful');
        return done(null, user);
      })
    }
  ));

  passport.serializeUser((user, done) =&gt; {
    console.log(user.username + &quot; serialized&quot;);
    done(null, user._id);
  });

  passport.deserializeUser((id, done) =&gt; {
    db.db().collection('users').findOne(
      {_id: new ObjectID(id)},
      (err, doc) =&gt; {
        done(null, doc);
      }
    );
  });
}
</code></pre>
<p><strong>The Question:</strong></p>
<p>All of the functions work just fine, I get all of the success return messages, and even register saves the user to the database, and login loads it successfully from the database. The only problem I'm having is that <code>req.isAuthenticated()</code> in the function <code>ensureAuthenticated</code> is always returning false, and as you can see, I really really really need it to be true so I can send the information to the client for the /profile route, and do all the other things I need with Passport. What am I missing?</p>

