<p>I'm trying to figure out if I have a bug somewhere or if this is not possible because it's not working.</p>
<pre><code>const Post = new mongoose.Schema({
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'user',
  },
  text: {
    type: String,
  }
})

const ProfileSchema = new mongoose.Schema({
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'user',
  },
  bio: {
    type: String,
    max: 500,
  }
});

ProfileSchema.virtual('posts', {
  ref: 'Post',
  localField: 'user',
