nodejs mongodb check a range against a single value<p>I have some documents as following in db:</p>
<pre><code>User A:
{
    &quot;_id&quot; : ObjectId(&quot;5f1ec1869ea3e213cc2a159e&quot;),
    &quot;age&quot;: 27,
    &quot;gender&quot;: &quot;male&quot;,
    &quot;preference&quot;: {
        &quot;ageGroup&quot;: &quot;25-35&quot;,
        &quot;gender&quot;: &quot;female&quot;
    }
}

User X:
{
    &quot;_id&quot; : ObjectId(&quot;378ec1869ea3e212333a159e&quot;),
    &quot;age&quot;: 27,
    &quot;gender&quot;: &quot;female&quot;,
    &quot;preference&quot;: {
        &quot;ageGroup&quot;: &quot;20-30&quot;,
        &quot;gender&quot;: &quot;male&quot;
    }
}
</code></pre>
<p>I am trying to filter docs based on :</p>
<ul>
<li>other users' profile <code>age</code> and <code>gender</code> must match against the user's preference.</li>
<li>other users' preference also must match against the user's profile <code>age</code> and <code>gender</code>.</li>
</ul>
<p>Here's what I am trying:</p>
<pre><code>const getGsaMatches = async function (currentUser) {
const user: any = await User.findOne({ _id: currentUser._id });
const userPreference = user.preference;

const ageRange = userPreference.ageGroup.split(&quot;-&quot;);
const minAgeRange = ageRange[0];
const maxAgeRange = ageRange[1];

const matchResponse: any = await User.find({       
