            return mongoClient.getDatabase(System.getenv(&quot;MONGO_DB_NAME&quot;));
        }

        context.getLogger().log(&quot;Reusing existing MongoDB connection&quot;);
        return mongoClient.getDatabase(System.getenv(&quot;MONGO_DB_NAME&quot;));
